import lavender from "./Images/lavender.png";
import lemongrass from "./Images/lemongrass.png";
import magnolia from "./Images/magnolia.png";
import mimosa from "./Images/mimosa.png";
import tiare from "./Images/tiare.png";
import muguet from "./Images/muguet.png";
import narcissus from "./Images/narcissus.png";
import neroli from "./Images/neroli.png";
import oakmoss from "./Images/oakmoss.png";

const plants1 = [
  {
    id: "10",
    img: lavender,
    name: "Lavender",
    desc:
      "Commercially, the plant is grown mainly for the production of lavender essential oil of lavender. English lavender (Lavandula angustifolia) yields an oil with sweet overtones, and can be used in balms, salves, perfumes, cosmetics, and topical applications.",
  },
  {
    id: "11",
    img: lemongrass,
    name: "Lemongrass",
    desc:
      "Cymbopogon, also known as lemongrass, Cochin grass, Malabar grass,is a genus of Asian, African, Australian, and tropical island plants in the grass family. Some species (particularly Cymbopogon citratus) are commonly cultivated as culinary and medicinal herbs because of their scent, resembling that of lemons (Citrus limon). ",
  },
  {
    id: "12",
    img: magnolia,
    name: "Magnolia",
    desc:
      "Magnolia fragrance is most often described as citruslike or lemony. In some species, the twigs and branches are also fragrant or aromatic with lemon overtones.",
  },
  {
    id: "13",
    img: mimosa,
    name: "Mimosa",
    desc:
      "The sweet, warm, powdery smell we encounter in perfumery, with its facets of almond, honey, violet, craft paste and fresh cucumber, comes from distillation of the soft, feathery yellow petal clusters of the acacia species that most of us in the West know as mimosa flowers.",
  },
  {
    id: "14",
    img: tiare,
    name: "Monoi",
    desc:
      "The Monoi Tiaré Tahiti is a perfume-oil made by infusing the blossoms of Tiaré flowers in coconut oil.It can be traced back 2000 years, used by the Maohi people,indiginous Polynesians.The tiare flower (Gardenia tahitensis), from the family Rubiaceae, is Tahiti's national flower.",
