  },
  {
    id: "16",
    img: narcissus,
    name: "Narcissus",
    desc:
      "Throughout history the scent of narcissi has been an important ingredient of perfumes, a quality that comes from essential oils rather than alkaloids. Narcissi are also an important horticultural crop, and source of cut flowers (floriculture).",
  },

  {
    id: "17",
    img: neroli,
    name: "Neroli",
    desc:
      "Neroli oil is an essential oil produced from the blossom of the bitter orange tree (Citrus aurantium subsp. amara or Bigaradia). Its scent is sweet, honeyed and somewhat metallic with green and spicy facets.",
  },
  {
    id: "18",
    img: oakmoss,
    name: "Oakmoss",
    desc:
      "Oakmoss is commercially harvested in countries of South-Central Europe and usually exported to the Grasse region of France where its fragrant compounds are extracted as oakmoss absolutes and extracts. These raw materials are often used as perfume fixatives and form the base notes of many fragrances.",
  },
];
